var CloudTalk=function(a){this.m_sCloudTalkPath=a;this.joinRoom=function(b,e,d,c,f){$.ajax({url:this.m_sCloudTalkPath+"JoinRoom",type:"POST",data:{Name:e,Email:d,RoomName:b},success:c,error:f,dataType:"json"})};this.leaveRoom=function(b,c){$.ajax({url:this.m_sCloudTalkPath+"LeaveRoom",type:"POST",data:{Email:c,RoomName:b}})};this.getEvents=function(c,b,d){$.ajax({url:this.m_sCloudTalkPath+"Events?email="+c+"&ts="+new Date().getTime(),success:b,error:d,type:"GET",dataType:"json"})};this.sendMessage=function(b,e,c,d,f){$.ajax({url:this.m_sCloudTalkPath+"SendMessage",type:"POST",data:{Message:c,ClientEmail:e,RoomName:b},success:d,error:f})}};